import { createTheme } from "@mui/material";
import { neutral } from "./colors";

const customtheme = createTheme({
    status:{
        danger: neutral[500],
    },

    palette: {
        primary: {
        //   light: neutral[100],
        //   main: neutral[200],
        //   dark: neutral[300],
        //   contrastText: neutral[400],
        },
        secondary: {
          light: neutral[900],
          main: neutral[800],
          dark: neutral[700],
          contrastText: neutral[600],
        },
      },
})

export default customtheme;
